	// 						name="email"
	// 						type="text"
	// 						className="form-control"
	// 						placeholder="Enter email"
	// 						// onChange={this.handleChange.bind(this, "email")}
	// 						// value={this.state.fields["email"]}
	// 						required="required" />

	// 					<input
	// 						ref="password"
	// 						name="password"
	// 						// type={this.state.hidden ? 'password' : 'text'}
	// 						className="form-control"
