	// 						// onChange={this.handleChange.bind(this, "password")}
	// 						// value={this.state.fields["password"]}
	// 						required="required" />
	// 					<div className="form-group" align="center">
	// 						<p>item</p>
	// 					</div>
	// 					<div className="text-center" align="center">
	// 						<p>item</p>

